import './App.css';
import Video from './component/video';
import data from './component/data/data';
import { useState } from 'react';
import AddVideo from './component/addVideo';


function App() {

  console.log('App Render')

 const [video, setVideo] = useState(data);

 console.log(video)


//  console.log(video)

 const obj = {
  id: video.length + 1,
  title: 'MongoDB full tutorial in 10 Hours',
  channelName: 'Nurmagomedov',
  isVerified: true,
  view: '35M',
  userCountry: 'Russia',
 }


  function VideoAdd() {
    setVideo()
  }


  return (
    <>
        <div className='container'>



      {data.map(video => {

        return <Video
        id={video.id}
        key={video.id}
        title={video.title}
        channelName={video.channelName}
        isVerified={video.isVerified}
        view={video.view}
        time={video.time}
        ></Video>

      })}
      <AddVideo VideoAdd={VideoAdd}></AddVideo>
    </div>

    </>


  );
}

export default App;
